import React, { useEffect } from 'react'
import { useState } from 'react'
import ProductService from '../services/ProductService';

const OrderAdminTableRow = ({order}) => {

    const [product, setProduct] = useState({});
    useEffect(() => {
     const fetchProduct = async ()=>{
        try {
            const response = await ProductService.getProductById(order.productId);
            setProduct(response.data);
        } catch (error) {
            console.log(error);
        }
     }

     fetchProduct();
    }, [])

    const getDeliveryStatus = (paid) =>{
        if(paid)
         return <button style={{backgroundColor:"green"}}>Paid</button>;
        else
        return <button style={{backgroundColor:"red"}}>Not Paid</button>
    }
    
  return (
    <tr>
        <td>{order.id}</td>
        <td>{order.userId}</td>
        <td>{product.name}</td>
        <td>{order.price}</td>
        <td>{order.quantity}</td>
        <td>{getDeliveryStatus(order.isPaid)}</td>
        <td>{order.isPaid}</td>
        <td>{order.isDelivered}</td>
    </tr>
  )
}

export default OrderAdminTableRow
